var stop=true;
$(function(){
    changeToBeContinued();
    window.setInterval(changeToBeContinued, 1000);
    InitImgs();
    $("#HD").click(function(){
        var password = $("#password").val();
        if($("#i1").attr("src").indexOf("data:image") != -1){
            alert("IT'S HD");
            return;
        }
        var result = Secret_Key(data.img[0].srcs[0].HD, password, 'decryption')
        if(result.indexOf("data:image") == -1){
            alert("Password Error");
            return;
        }
        GetHD(password)
        $("#Aloe").html("Aloe-HD");
    });
    GetVisits();
    $(window).scroll(function(){
        totalheight = parseFloat($(window).height()) + parseFloat($(window).scrollTop());
        if($(document).height() - 20 <= totalheight){
            if(stop==true){
                stop=false;
                //
                setTimeout(InitImgs,400)
                stop=true;
            }
        }
    });
    $("#Aloe").click(function(){
        window.location.href="https://github.com/Pliterature/Aloe";
    });
})

function GetVisits(){
    $.get("https://api.jsonbin.io/b/5c663a246874aa33ba117061/latest",function(result){
        if(typeof result.Visits !== 'number'){
            return;
        }
        $("#visit").eq(0).html("@" + result.Visits);
        result.Visits ++;
        $.ajax({
            url: 'https://api.jsonbin.io/b/5c663a246874aa33ba117061',
            contentType: 'application/json',
            type: 'PUT',
            data: JSON.stringify(result),
            success: function(response) {
                if(response.success){
                    $("#visit").eq(0).html("@" + response.data.Visits);
                }
            }
         });
    })
}

function GetHD(password){
    $.each(data.img, function(i, item) {
        $.each(item.srcs, function(i, element) {
            var result = Secret_Key(element.HD, password, 'decryption')
            $("#" + element.id).attr("src", result);
        });
    });
}

